/*
 *  The main function
 */
int main(int argc, char** argv) {

  test_network();
  return 0;

  QuakePredictor QP;

  int sampleRate, S, SLEN;
  cin >> sampleRate;
  cin >> S;
  cin >> SLEN;

  vector<double> sitesData;
  for (int s = 0; s < SLEN; s++) {
    double tmp;
    cin >> tmp;
    sitesData.push_back(tmp);
  }

  int ret = QP.init(sampleRate, S, sitesData);
  cout << ret << endl;

  int doTraining = 0;
  cin >> doTraining;
  if (doTraining) {
    // pass
  }

  // Read data for each hour
  while (true) {
    int hour;
    cin >> hour;
    if (hour < 0) {
      break;
    }

    int DLEN;
    cin >> DLEN;
    vector<int> data;
    for (int d = 0; d < DLEN; d++) {
      double tmp;
      cin >> tmp;
      data.push_back(tmp);
    }

    double K;
    cin >> K;

    int QLEN;
    cin >> QLEN;
    vector<double> globalQuakes;
    for (int q = 0; q < QLEN; q++) {
      double tmp;
      cin >> tmp;
      globalQuakes.push_back(tmp);
    }

    // The big forecast call
    vector<double> retM;
    retM = QP.forecast(hour, data, K, globalQuakes);
    cout << retM.size() << endl;
    for (int r = 0; r < retM.size(); r++) {
      cout << retM[r] << endl;
    }
  }

  return 0;
}
